    selectStates.change(function (e) {

        let b = [];
        $('#state :selected').each(function() {
            b.push(parseInt($(this).val()));
        });

        //filter data to selected IPs
        let filtered = data.filter(function (obj) {
            if (b.length > 0) {
                return b.includes(obj.stateCode);
            } else {
                return data;
            }
            return data;
        });

        console.log(filtered)

        addLgas(filtered);

        addFacilities(filtered);
    });

    selectLGAs.change(function (e) {

        let b = [];
        $('#lga :selected').each(function() {
            b.push(parseInt($(this).val()));
        });

        //filter data to selected IPs
        let filtered = data.filter(function (obj) {
            if (b.length > 0) {
                return b.includes(obj.lgaCode);
            } else {
                return data;
            }

        });

        addFacilities(filtered);
    });

    function addLgas(d) {

        if (selectLGAs === null || selectLGAs === undefined)
            return;

        //clear current
        selectLGAs.html("");

        //reduce object to just properties we need
        let g = d.map(({ lgaCode, lga }) => {
            return { lgaCode, lga };
        });

        // save current config options
        let select = selectLGAs.data('select2');
        let options = null;

        if (select !== undefined) {
            options = select.options.options;

            //filter duplicate lgas
            options.data = g.reduce((acc, current) => {
                const x = acc.find(item => item.lga === current.lga);
                if (!x) {
                    //append unique states to states' select2
                    selectLGAs.append("<option value=\"" + current.lgaCode + "\">" + current.lga + "</option>");
                    return acc.concat([current]);
                } else {
                    return acc;
                }
            }, []);
            //recreate select2
            selectLGAs.select2(options);

        }
    }

    function addFacilities(d) {

        if (selectFacilities == null)
            return;

        //clear current
        selectFacilities.html("");

        //reduce object to just properties we need
        let g = d.map(({ datimCode, facilityName }) => {
            return { datimCode, facilityName };
        });

        let select = selectFacilities.data('select2');
        let options = null;

        if (select !== undefined) {

            // save current config options
            options = select.options.options;

            //filter duplicate facilities TODO: there's no need for this
            options.data = g.reduce((acc, current) => {
                const x = acc.find(item => item.facilityName === current.facilityName);
                if (!x) {
                    //append unique states to states' select2
                    selectFacilities.append("<option value=\"" + current.datimCode + "\">" + current.facilityName + "</option>");
                    return acc.concat([current]);
                } else {
                    return acc;
                }
            }, []);
            //recreate select2
            selectFacilities.select2(options);
        }
    }

